As it was said before, ZRust is mostly about safety and security. Thus, variables are immutable by default. If you are going to change their values, you must explicitly mark them as mutable. It protects your data from accidental mutating where the compiler is unable to check your intentions. fn test() { let x = 0; // compile error: mutating an immutable variable // x = 42; let mut y = 0; y = 42; // ok
} If you are familiar with Rust, you will not have any trouble understanding this concept, since the syntax and semantics are almost identical. However, pattern matching and destructuring are not implemented yet. Immutable variables are similar to constants. Like with constants, you cannot change the immutable variable value. However, constants have some further restrictions: they cannot infer their type, can be declared only in the global scope, and obviously cannot be marked as mutable. In contrast to Rust, variables can only be declared in functions. If you need a global variable, you should declare a constant. This limitation is devised to prevent unwanted side effects, polluting the global namespace, and bad design. const VALUE: field = 0; // ok fn test() { // compile error: a constant not in the global scope // const VALUE: field = 0;
} Variable shadowing can be a convenient feature, but ZRust is going to enforce warning-as-error development workflow, forbidding shadowing as a potentially unsafe trick. You should use mutable variables and type suffixes if you have several variables with similar logical meaning. fn test() { let mut x = 5; { // compile error: redeclared variable 'x' // let x = 25; } // compile error: redeclared variable 'x' // let x = 25; x = 25; // ok
}

