The function is the only callable type in ZRust and it closely follows the Rust syntax. However, R1CS specifics require that functions must be executed completely, thus there is no return statement in ZRust. The only way to return a value is to specify it as the last unterminated statement of the function block. Functions consist of several parts: the name, arguments, return type, and the code block. The name is the function type name and it uniquely defines a function. The arguments can be only passed by value, and the function result can only be returned by value. If the return type is omitted, the function is considered to return the result of type (). The code block can access the global scope, but it has no information about where the function has been called from. const GLOBAL: u8 = 31; fn wierd_sum(a: u8, b: u8) -> u8 { side_effect(); // a statement a + b + GLOBAL // return value
} let result = wierd_sum(42, 27);
std::require(result == 100);

